import { Grid, Paper, Box } from '@material-ui/core/'


export default class App extends Component { 
	render() {
		return (
			<div className="App">
        <Router>
          <Grid container spacing={2}>
            <Grid item xs={2}>
              <Box m={1}>
                <Paper>
                  <Menu />
                </Paper>
              </Box>
            </Grid>
            <Grid item xs={10}>
              <Box m={1}>
                <Route path='/:id' render={({ match }) => <Main folderId={match.params.id} key={match.params.id} />} />
              </Box>
            </Grid>
          </Grid>
        </Router>
			</div>
		);
	}
}

